<!DOCTYPE html>
<html>

<head>
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <style>
        * {
            box-sizing: border-box;
			font-family : Century Gothic;
        }

		p {
            margin: 5px
        }

        h1 {
            margin: 11px
        }

		h2 {
            margin: 0px
        }

        h3 {
            margin: 5px
        }

        input {
            margin: 0
        }

		/* --------- THICK SCROLL BAR SECTION -------- */
		::-webkit-scrollbar {
            width: 30px;
            border: 5px solid white;

        }

        ::-webkit-scrollbar-thumb {
            background-color: #a7a7a7;
            background-clip: padding-box;
            border: 0.05em solid #eeeeee;
        }

        ::-webkit-scrollbar-track {
            background-color: #ebebeb;
        }

        /* Buttons */
        ::-webkit-scrollbar-button:single-button {
            background-color: #ebebeb;
            display: block;
            border-style: solid;
            height: 13px;
            width: 30px;
        }

        /* Up */
        ::-webkit-scrollbar-button:single-button:vertical:decrement {
            border-width: 0 15px 15px 15px;
            border-color: transparent transparent #555555 transparent;
        }

        ::-webkit-scrollbar-button:single-button:vertical:decrement:hover {
            border-color: transparent transparent #777777 transparent;
        }

        /* Down */
        ::-webkit-scrollbar-button:single-button:vertical:increment {
            border-width: 15px 15px 0px 15px;
            border-color: #555555 transparent transparent transparent;
        }

        ::-webkit-scrollbar-button:vertical:single-button:increment:hover {
            border-color: #777777 transparent transparent transparent;
        }

		/* --------- END THICK SCROLL BAR SECTION -------- */

        #myInput {
            background-image: url('images/search.png');
            background-position: 10px 12px;
            background-repeat: no-repeat;
            width: 100%;
            font-size: 16px;
            padding: 12px 20px 12px 40px;
            border: 1px solid #ddd;
            margin-bottom: 12px;
        }

        #buildingsList {
            list-style-type: none;
            padding: 0;
            margin: 0;
        }

        #buildingsList li a {
            border: 1px solid #ddd;
            margin-top: -1px;
            /* Prevent double borders */
            background-color: #f6f6f6;
            padding: 12px;
            text-decoration: none;
            font-size: 18px;
            color: black;
            display: block
        }

        #buildingsList li a:hover:not(.header) {
            background-color: #eee;

        }

        table {
            width: 100%;
        }

        td {
            vertical-align: top;
        }

        .d1 {
            text-align: left;
            width: 25%;
        }

        .d2 {
            text-align: center;
            width: 25%;
        }

        .d2 {
            text-align: center;
            width: 25%;
        }
        .copy,
        .d3 {
            white-space: nowrap;
        }

        .d3 {
            text-align: right;
            width: 25%;
        }

        .copy,
        .d3 {
            white-space: nowrap;
        }

        .show {
            color: #777;
            visibility: visible;
        }

        .return {
            position: relative;
            padding: 15px 40px;
            text-align: center;
        }

        .btnimg {
            position: absolute;
            left: 2.5px;
            top: 50%;
            transform: translateY(-50%);
        }

        .center {
            position: absolute;
            margin-left: auto;
            margin-right: auto;
            width: 50%;
        }

        .dispCol1 {
            text-align: center;
            vertical-align: middle;
            width: 33%
        }

        .dispCol2 {
            text-align: center;
            vertical-align: middle;
            width: 33%
        }

        .dispCol3 {
            vertical-align: middle;
            text-align: center;
            width: 33%;
        }

        .dispCol3 button {
            display: block;
            padding: 10px 24px;
            margin-left: auto;
            margin-right: auto;
            width: 50%;
        }

        .copy {
            visibility: hidden;
        }

        .floorButton {
            font-size: 30px;
            text-align: center;
        }

        .buildingTable {
            overflow-y: scroll;
            height: 187px;
            display: block;
        }
        .top {
            display: flex;
            justify-content: flex-start;
            position: relative;
            left: 0px;
            bottom: -7px;
        }

        .top2 {
            display: flex;
            justify-content: flex-start;
            position: relative;
            left: 57px;
            bottom: -7px;
        }

        .top3 {
            display: flex;
            justify-content: flex-start;
            position: relative;
            left: 114px;
            bottom: -7px;
        }

        .top4 {
            display: flex;
            justify-content: flex-start;
            position: relative;
            left: 171px;
            bottom: -7px;
        }

        .top5 {
            display: flex;
            justify-content: flex-start;
            position: relative;
            left: 228px;
            bottom: -7px;
        }
		.shortcut {
            position: relative;
            padding: 20px 20px;
            text-align: center;
            background-color: #FFD520;
            
        }
		.shortcuton {
            position: relative;
            padding: 20px 20px;
            text-align: center;
            background-color: #ffeea8;
            
        }
		body.noscroll{
            position:fixed;
            overflow:hidden;
            background-image: url(images/UMDbar.jpg); 
            background-position: top;
            background-attachment: fixed; 
            background-repeat: no-repeat;
        }
    </style>
</head>

        // Populate our list with everything in the "buildings" json
        for (let buildingName of Object.keys(buildings).sort()) {
            let buildingsList = document.getElementById("buildingsList");

            let li = document.createElement("li");
            buildingsList.appendChild(li);
            let a = document.createElement("a");
            a.href = "#";
            li.appendChild(a);
            let table = document.createElement("table");
            a.appendChild(table);
            let tr = document.createElement("tr");
            tr.addEventListener('click', function () {
                selectBuilding(buildingName);
            });
            table.appendChild(tr);
            let td1 = document.createElement("td");
            td1.className = "d1";
            let buildingNameText = document.createTextNode(buildingName);
            td1.appendChild(buildingNameText);
            tr.appendChild(td1);
            let td2 = document.createElement("td");
            td2.className = "d2";
            let abbreviationText = document.createTextNode(buildings[buildingName].abbreviation);
            abbreviationText.style = "text-align:center";
            td2.appendChild(abbreviationText);
            tr.appendChild(td2);
            let td2a = document.createElement("td");
            td2a.className = "d2";
            let addressText = document.createTextNode(buildings[buildingName].address);
            addressText.style = "text-align:center";
            td2a.appendChild(addressText);
            tr.appendChild(td2a);
            let td3 = document.createElement("td");
            td3.className = "d3";
            let departmentsText = document.createTextNode(buildings[buildingName].departments);
            td3.appendChild(departmentsText);
            tr.appendChild(td3);
        }

        function buildingSearch() {
            var input, filter, ul, li, a, i, txtValue;
            input = document.getElementById("myInput");
            filter = input.value.toUpperCase();
            ul = document.getElementById("buildingsList");
            li = ul.getElementsByTagName("li");
            for (i = 0; i < li.length; i++) {
                a = li[i].getElementsByTagName("a")[0];
                txtValue = a.textContent || a.innerText;
                if (txtValue.toUpperCase().indexOf(filter) > -1) {
                    li[i].style.display = "";

                } else {
                    li[i].style.display = "none";
                }
            }
        }

        // Called when you click on a building in the list and
        // when you click on a building's bubble on the map
        function selectBuilding(buildingName) {
            // stop displaying any previous room info
            let buildingInfoHolder = document.getElementById("buildingInfoHolder");
            let oldBuildingInfo = document.getElementById("buildingInfo");
            if (oldBuildingInfo != null)
                buildingInfoHolder.removeChild(oldBuildingInfo);

            // create new building info
            let newBuildingInfo = document.createElement("div");
            newBuildingInfo.id = "buildingInfo";
            newBuildingInfo.style = "max-width: 500px; margin-left:auto; margin-right:auto";

            // contents of building info
            // building name
            let buildingNameEle = document.createElement("p");
            let buildingNameTitle = document.createTextNode(buildingName);
            buildingNameEle.appendChild(buildingNameTitle);
            buildingNameEle.style = "font-size:160%";
            newBuildingInfo.appendChild(buildingNameEle);

            // See if we have data for the building
            if (buildings[buildingName] === undefined) {
                let noInfo = document.createElement("p");
                let noInfoText = document.createTextNode("Sorry, no data for this room is available.");
                noInfo.appendChild(noInfoText);
                noInfo.style = "font-size:150%";
                newBuildingInfo.appendChild(noInfo);

                let description = document.createElement("p");
                let descriptionText = document.createTextNode("Try another room.");
                description.appendChild(descriptionText);
                newBuildingInfo.appendChild(description);
            }
            else {
                // abbreviation
                let abbreviation = document.createElement("p");
                let abbreviationText = document.createTextNode(buildings[buildingName].abbreviation);
                abbreviation.appendChild(abbreviationText);
                abbreviation.style = "font-size:140%";
                newBuildingInfo.appendChild(abbreviation);
				// address (if applicable)
                if (buildings[buildingName].addresss !== "") {
                    let address = document.createElement("p");
                    let addressText = document.createTextNode(buildings[buildingName].address);
                    address.appendChild(addressText);
                    address.style = "font-size:100%";
                    newBuildingInfo.appendChild(address);
                }
                // departments (if applicable)
                if (buildings[buildingName].departments !== "") {
                    let departments = document.createElement("p");
                    let departmentsText = document.createTextNode("Departments: " + buildings[buildingName].departments);
                    departments.appendChild(departmentsText);
                    departments.style = "font-size:130%";
                    newBuildingInfo.appendChild(departments);
                }
                // description
                let description = document.createElement("p");
                let descriptionText = document.createTextNode(buildings[buildingName].description);
                description.style = "font-size:110%"
                description.appendChild(descriptionText);
                newBuildingInfo.appendChild(description);
                // image (if applicable)
                if (buildings[buildingName].buildingImg !== "") {
                    let buildingImg = document.createElement("img");
                    buildingImg.src = "./images/building_imgs/" + buildings[buildingName].buildingImg;
                    buildingImg.alt = buildingName;
                    buildingImg.style = "max-height:220px; max-width:220px;"
                    newBuildingInfo.appendChild(buildingImg);
                }
            }

            // append new room info to the room info holder
            buildingInfoHolder.appendChild(newBuildingInfo);

		}
